const Home = () => {
  return (
    <>
      {/* start header with image background */}
      <header class="home-cover">
        <img src="images/rectangle-17.png" alt="" />
        <div class="overlay">
          <div class="container">
            <h1>Simple Blog.</h1>
            <p>A blog created by FikraCamps</p>
          </div>
        </div>
      </header>
    </>
  );
};
export default Home;
